    public static int[] quicksort(int[] numbs) {
        if (numbs.length < 2) return numbs;
        int pivo = numbs[0];
        int n = numbs.length;

        int[] greaters = constructSubarray(numbs, n, num -> num > pivo);
        int[] smallers = constructSubarray(numbs, n, num -> num < pivo);

        return merge(quicksort(smallers), pivo, quicksort(greaters), n);
    }

    // returns an array that is smaller or greater than given pivo
    public static int[] constructSubarray(int[] numbs, int n, Predicate<Integer> condition) {
        List<Integer> values = new ArrayList<>();

        for (int i = 0; i < n; i++) if (condition.test(numbs[i])) values.add(numbs[i]);

        return values.stream().mapToInt(Integer::intValue).toArray();
    }

    // merge smallers, pivo and greaters, where pivo is placed in the middle of the arrays
    public static int[] merge(int[] smallers, int pivo, int[] greaters, int n) {
        int[] values = new int[n];
        int index = 0;

        for (int i = 0; i < smallers.length; i++) values[index++] = smallers[i];
        values[index++] = pivo;
        for (int i = 0; i < greaters.length; i++) values[index++] = greaters[i];

        return values;
    }
